import React from "react";
import Products from "../components/Products";

function ProductPage() {
  return (
    <>
      <main className="pt-[72px] h-auto w-full flex flex-col">
        <div className="flex h-[300px] w-full outline">
          <span className="flex w-full h-full items-center justify-center text-bold text-3xl uppercase">
            OUR PRODUCT
          </span>
        </div>
      </main>
    </>
  );
}

export default ProductPage;
